description:
All albums of Genesis from 1969 to 1974, while Peter Gabriel was in the band:

- From Genesis To Revelation - 1969;

- Trespass - 1970;

- Nursery Cryme - 1971;

- Foxtrot - 1972;

- Genesis Live - 1973;

- Selling England By The Pound - 1973;

- The Lamb Lies Down On Broadway - 1974.


All albums were cloned from the original remastered CD's of 1994 Virgin Records edition, except From Genesis To Revelation 1993 remastered edition of Music Club.

Clone CD is included in the package!


